import{_ as r}from"./chunks/viewer-infopoint.I1dtnFed.js";import{_ as e,c as a,o,b0 as i}from"./chunks/framework.w6NQj85O.js";const n="data:image/png;base64,",p="/assets/viewer-tree-expand.1Hf1rW9C.png",s="/assets/viewer-tree-expand-again.BWaOzzmT.png",d="data:image/png;base64,",l="/assets/viewer-bookmark.CcVeE8UK.png",h="/assets/viewer-flame-open.BVNkHYBZ.png",g="/assets/viewer-flame.zhSmuIrX.png",c="data:image/png;base64,",R=JSON.parse('{"title":"正确使用报告浏览器","description":"","frontmatter":{},"headers":[],"relativePath":"spark/spark.using-the-viewer.md","filePath":"spark/spark.using-the-viewer.md"}'),A={name:"spark/spark.using-the-viewer.md"};function m(k,t,b,S,u,C){return o(),a("div",null,t[0]||(t[0]=[i('<h1 id="正确使用报告浏览器" tabindex="-1">正确使用报告浏览器 <a class="header-anchor" href="#正确使用报告浏览器" aria-label="Permalink to &quot;正确使用报告浏览器&quot;">​</a></h1><p>在你使用命令 <code>/spark profiler</code> 生成了一份分析报告之后，它将会自动上传至浏览器，并以链接的形式呈现在聊天栏。</p><p>你可以将这个链接分享给其他用户，例如插件开发者，来帮助分析遇到的问题！</p><h2 id="报告浏览器解释" tabindex="-1">报告浏览器解释 <a class="header-anchor" href="#报告浏览器解释" aria-label="Permalink to &quot;报告浏览器解释&quot;">​</a></h2><p>在你第一次见到分析报告的输出时，它可能看起来非常复杂，难以理解。</p><p>这有可能是因为 spark 在这个界面中能且仅能提供的信息是其下的类/方法名（例如，开发者在代码中使用的名称），以此描述正在发生的事情。但是，你只需一些常识，稍加思考即可看出报告所表达的内容。</p><p>试试看吧！下面是一些名词释义，这可以帮助你更快速地读懂分析报告。😃</p><h3 id="线程" tabindex="-1">线程 <a class="header-anchor" href="#线程" aria-label="Permalink to &quot;线程&quot;">​</a></h3><p>当你第一次打开报告浏览器时，你会看见一个被记录的<strong>线程</strong>列表。</p><p>你可以把线程想象成一个在客户端/服务端/等等...干活的工人。以 Minecraft <em>服务器</em>为例，我们感兴趣的线程一般叫做“服务器线程”，这是服务端用于运行游戏的线程。</p><p><img src="'+n+'" alt="img" title="一张图片，显示了服务器主线程的名称。"></p><h3 id="调用框架-节点" tabindex="-1">调用框架（“节点”） <a class="header-anchor" href="#调用框架-节点" aria-label="Permalink to &quot;调用框架（“节点”）&quot;">​</a></h3><p>在报告中，我们可以在每个框架下看到三部分信息。即<em>名称</em>、框架与整个线程的<em>占用时间比</em>，以及耗时（只在鼠标移动至其上时显示）。</p><p>（在报告底部或顶部显示的）线程总是会显示 <code>100%</code>——这是因为这条线程包含了服务器的所有运算，其余框架都是从主线程分配用量进行各自预算的。</p><p>当你在报告中<strong>将鼠标移动至</strong>节点<strong>上</strong>时，抽样分析在报告生成期间所预测的耗时会在其中的右侧显示。</p><h3 id="信息点" tabindex="-1">信息点 <a class="header-anchor" href="#信息点" aria-label="Permalink to &quot;信息点&quot;">​</a></h3><p>一些常见/值得注意的框架调用会在旁边显示一个 ⓘ <strong>信息点</strong> 符号。</p><p>在这些符号上悬停，浏览器会为你显示一些调用框架有关的额外描述。</p><p><img src="'+r+'" alt="img"></p><p>这些描述是开源的（可以通过社区简单地编辑/改进），如果你注意到某些东西看起来不太对，或者某个线程/方法调用值得加上一段描述，请务必来为我们贡献！😎</p><h3 id="展开条目" tabindex="-1">展开条目 <a class="header-anchor" href="#展开条目" aria-label="Permalink to &quot;展开条目&quot;">​</a></h3><p>你可以<strong>点击</strong>节点，展开并浏览它的<strong>子节点</strong>。这些子节点会在它下方显示。</p><p><img src="'+p+'" alt="img" title="一张图片，显示了展开的节点与其下的子节点的内容。"></p><p>当在这个示例中展开“服务器线程”时：</p><ul><li>它唯一的子节点是 <code>java.lang.Thread.run()</code> - 这是服务器线程的切入点，可以忽略；</li><li><em>这个子节点</em>下的子节点则是 <code>MinecraftServer.run()</code> - 很好！这就是 Minecraft 服务器进程的切入点；</li><li><em>这个字节点</em>下的两个子节点则是 <code>MinecraftServer.tick()</code> 和 <code>Thread.sleep()</code>。</li></ul><p>正如在“刻循环教程”章节所体积的那样，任何花在休眠（或标有“parked”字样的线程）上的时间都表示服务器正常运行！我们可以先不看这些。</p><p>但是，<code>MinecraftServer.tick()</code> 则是我们排除工作的开始点。我们可以点击它来进一步展开。</p><h3 id="进一步分析" tabindex="-1">进一步分析 <a class="header-anchor" href="#进一步分析" aria-label="Permalink to &quot;进一步分析&quot;">​</a></h3><p><img src="'+s+'" alt="img" title="一张图片，显示了进一步展开的子节点列表。"></p><p>这个时候，我们就可以看到服务器执行的方法被分别展示在了我们的报告中。</p><p>我们已经可以看到一些关键词了：</p><ul><li><code>WorldServer.doTick()</code> - 很有可能是正在“滴答”世界 - 也许是方块、红石等东西？</li><li><code>WorldServer.tickEntities()</code> - 很有可能是正在“滴答”实体 - 猜起来很容易！</li><li><code>CraftScheduler.mainThreadHeartbeat()</code> - 这是 CraftBukkit 正在执行定时插件任务；</li><li>...诸如此类 - 你可以大胆猜测它们的功能！</li></ul><p>当然，如果你不能根据名字得出它的功能或者还需要更多细节（通常是这个）的话：你可以继续展开节点。</p><h3 id="找到性能问题的根源" tabindex="-1">找到性能问题的根源 <a class="header-anchor" href="#找到性能问题的根源" aria-label="Permalink to &quot;找到性能问题的根源&quot;">​</a></h3><p>现在你知道如何浏览报告了，找到“掉链子”的部分只需看右侧的数字展开——也就是，<strong>每个节点</strong>旁边显示的<strong>百分比</strong>。这些子节点会在它下方显示。</p><p>这代表着这部分代码所消耗的时间占比。</p><p>所以，如果你继续展开，找到哪一部分有着<em>相对高</em>的百分比——你最终就会找到问题所在！</p><p>这部分的示例可以在“卡顿原因寻找教程”章节中找到。</p><h2 id="应用反混淆" tabindex="-1">应用反混淆 <a class="header-anchor" href="#应用反混淆" aria-label="Permalink to &quot;应用反混淆&quot;">​</a></h2><p>Minecraft 客户端/服务器混淆（“加密代码，让代码更难被读懂”）了所有的方法和类名。这绝对会是排除问题的一大障碍！</p><p>好在，报告浏览器可以加入反混淆（“解密代码”），让我们能重新读懂这些名字。</p><p>默认情况下，<strong>浏览器会自动检测所需要使用的映射表</strong>。但是，如果这不奏效，你可能需要手动选择正确的映射表。</p><p>你可以在页面的<strong>右上角</strong>的<strong>下拉式菜单栏</strong>中找到这一部分的内容。</p><p><img src="'+d+'" alt="img" title="一张图片，显示了用户所手动选择的反混淆映射表类型。"></p><h2 id="标记特定的调用方法" tabindex="-1">标记特定的调用方法 <a class="header-anchor" href="#标记特定的调用方法" aria-label="Permalink to &quot;标记特定的调用方法&quot;">​</a></h2><p>在分析你的报告时，你可能会注意到一些特别的方法，并想要把它标记，用于之后的排除或展示给其他用户看。</p><p>最简单的方法就是“标记”这个方法。</p><p>你可以按住 <code>alt</code> 键并左键点击调用的方法来标记它，就像泰拉瑞亚将物品标记为“收藏”那样。</p><p>你也可以<strong>右键点击</strong>调用的方法，然后在弹出的菜单中点击**“Toggle bookmark（标记）”**</p><p><img src="'+l+'" alt="img" title="一张图片，显示了在方法上右键所弹出的菜单，并选择了“标记”选项。"></p><p>你会注意到这个方法变成了红色。</p><p>额外地，一段参数会显示在网址的末尾，以此“编码”标记。如果你将这个修改过的链接<strong>分享</strong>给其他用户，那么他们也可以看见你的标记，如果标记在子节点，则会自动展开。</p><h2 id="浏览" tabindex="-1">浏览 <a class="header-anchor" href="#浏览" aria-label="Permalink to &quot;浏览&quot;">​</a></h2><p>报告浏览器支持一些不同的浏览（模式）。</p><p>你可以通过点击上方控制栏的 <code>👁️</code> 按钮来切换浏览模式。</p><h3 id="浏览全部" tabindex="-1">浏览全部 <a class="header-anchor" href="#浏览全部" aria-label="Permalink to &quot;浏览全部&quot;">​</a></h3><p>此为浏览器的默认浏览模式。这会完整地显示可展开的节点。</p><h3 id="直观浏览" tabindex="-1">直观浏览 <a class="header-anchor" href="#直观浏览" aria-label="Permalink to &quot;直观浏览&quot;">​</a></h3><p>直观浏览模式会精简所显示的报告，它会将前 250 个耗时最大的方法排序并显示。这在排除调用时间较长的方法时会很有用。</p><p>这个浏览模式下有两个不同的<strong>显示</strong>模式。</p><table tabindex="0"><thead><tr><th>显示模式</th><th>描述</th></tr></thead><tbody><tr><td><strong>从上往下</strong></td><td>调用树“正常”显示——展开一个节点会显示它调用的子方法。</td></tr><tr><td><strong>从下往上</strong></td><td>调用树的显示顺序是倒过来的——展开的一个节点会显示调用了它的方法。</td></tr></tbody></table><p>这个浏览模式下有两个不同的<strong>排序</strong>模式。</p><table tabindex="0"><thead><tr><th>排序模式</th><th>描述</th></tr></thead><tbody><tr><td><strong>总用时</strong></td><td>方法会根据它们的“总用时”（方法内执行代码与子级调用所花费时间的和）进行排序。</td></tr><tr><td><strong>自用时</strong></td><td>方法会根据它们的“自用时”（仅方法内执行代码所花费的时间）进行排序。</td></tr></tbody></table><h3 id="溯源浏览" tabindex="-1">溯源浏览 <a class="header-anchor" href="#溯源浏览" aria-label="Permalink to &quot;溯源浏览&quot;">​</a></h3><p>若你需要找到性能表现糟糕的插件或模组，<strong>溯源</strong>浏览模式会很有用。</p><p>在这个模式下，报告中会分别显示每个插件/模组的进程。树会在顶部过滤显示它们调用所有的外部方法。</p><p>这个浏览模式下有两个不同的<strong>合并</strong>模式。</p><table tabindex="0"><thead><tr><th>合并模式</th><th>描述</th></tr></thead><tbody><tr><td><strong>合并</strong></td><td>签名相同的调用方法会被合并，无视其是否来自相同的调用方法。</td></tr><tr><td><strong>分离</strong></td><td>有相同签名但不是被同一方法调用的方法会分开显示。</td></tr></tbody></table><h2 id="火焰图" tabindex="-1">火焰图 <a class="header-anchor" href="#火焰图" aria-label="Permalink to &quot;火焰图&quot;">​</a></h2><p>火焰图是查看报告的一种新兴方式。</p><p>这能让浏览器上的内容更加容易被你理解（或者只是理解其中的一部分）。</p><p>若要打开火焰图浏览模式，只需要在顶部的控制栏点击“火焰”标志，或者<strong>右键</strong>点击一个线程/方法调用之后，再在弹出的菜单中选择**“View as Flame Graph（以火焰图浏览）”**</p><p><img src="'+h+'" alt="img" title="一张图片，显示了在方法上右键所弹出的菜单，并选择了“以火焰图浏览”选项。"></p><p>如此操作过后，便可打开火焰图浏览模式。</p><p><img src="'+g+'" alt="img" title="一张图片，显示了火焰图浏览模式中各个方法或线程显示的样式。"></p><p>在这个模式中，每个节点的<strong>长度</strong>，<strong>对应</strong>了执行这部分内容所消耗的时间。</p><p>你可以<strong>点击</strong>一个节点来“<strong>详细查看</strong>”它，这会让这条内容张开并放大显示。其下的子节点也会一并展开。</p><p>你可以将鼠标<strong>悬浮其上</strong>来显示它的完整方法名和其处理用时。</p><p>若要退出火焰图浏览模式，返回正常的阅读模式，只需点击在页面<strong>右上角</strong>的“Exit Flame View（退出火焰图浏览模式）”即可。</p><p><img src="'+c+'" alt="img" title="一张图片，显示了“退出火焰图浏览”按钮的样子。"></p>',80)]))}const J=e(A,[["render",m]]);export{R as __pageData,J as default};
